import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Component">
        <h1>App Component</h1>

        <div class="formgroup" id="name-form">
            <label for="name">Your name*</label>
            <input type="text" id="name" name="name" />
        </div>
      </div>
    </div>
  );
}

export default App;
